(1, 'Team India on top as Bangladesh two wickets away from getting bowled out', 5, 4, '<p>Team India were humbled 2-1 by a resurgent Bangladesh team in the three-match ODI series which the visitors managed to end on a high thanks to Ishan Kishanâ€™s record double century. The Indian cricket team will now want to switch gears to prepare themselves for red-ball cricket as the first Test against Bangladesh gets underway in Chattogram on Wednesday (December 14). India will resume on 278/6 on Day 2 of the first Test on Thursday (December 15).</p><p>The Indian side will be led by KL Rahul with regular skipper Rohit Sharma ruled out after dislocating his thumb in the second ODI against Bangladesh last week. Shubman Gill is expected to take Rohitâ€™s place at the top of the order alongside stand-in skipper Rahul.<br></p><p>Bangladesh, on the other hand, will be led by veteran all-rounder Shakib al Hasan with Tamim Iqbal missing both the ODI and the Test series with injury. The home side will have their task cut out against the world No. 2-ranked Test side India as they eye first-ever Test match win over them.</p><p>India have promised to play aggressive cricket, much like Englandâ€™s â€˜Bazballâ€™ model which has powered them to a Test series win over Babar Azamâ€™s Pakistan. India need win at least 5 of the next 6 upcoming Tests, which includes the next two Test matches against Bangladesh to assure them of a qualification spot in the World Test Championships final next year.</p><p>The Indian side is injury-hit with the likes of Mohammed Shami and Ravindra Jadeja also ruled out with injury apart from skipper Rohit. It will be interesting to see if Jaydev Unadkat will make a return to Test cricket after a gap of 12 years. Mohammed Siraj and Umesh Yadav will be expected the carry the pace-bowling load while Ravichandran Ashwin and Kuldeep Yadav will team up in the spin bowling department.</p><p>Check all the LIVE Scores and Updates from Day 1 of 1st Test between India and Bangladesh here.</p>', '2022-12-15 18:08:34', '2023-10-04 13:50:58', 1, 'Team-India-on-top-as-Bangladesh-two-wickets-away-from-getting-bowled-out', '1167610aa17b0813233fe82d99403e41.jpg', 9, 'admin', NULL),
(2, 'Creative Christmas gift ideas for kids', 3, 8, '<p>With Christmas, a few weeks from now, planning a gift for your kids can be a task quite challenging. Worry not! We have a few ideas for all the parents who are looking for those creative gifts to make their kids Xmas merry.<br></p><div><br></div><p>Being unprepared for Christmas is the very last thing you want. Start looking for presents now, or at the very least start thinking about ideas, rather than waiting until the last minute and this guide is your saviour.<br></p>', '2022-12-15 18:14:00', '2023-10-04 13:50:58', 1, 'Creative-Christmas-gift-ideas-for-kids', '646c8915fc1096c12b679108e7022df9.jpg', 10, 'admin', NULL),
(3, 'Petrol prices still high in your city? Centre blames THESE for costly fuel !', 4, 9, '<p>The minister said, currently the petrol price in India is one of the lowest. He said the oil marketing companies together suffered losses of Rs 27,276 crore due to high prices of crude in international markets.</p><p><br></p><p>Six states - West Bengal, Tamil Nadu, Andhra Pradesh, Telengana, Kerala, and Jharkhand - have not reduced the VAT, he said amidst vocal protests by the opposition members. The minister said, currently the petrol price in India is one of the lowest.&nbsp;</p>', '2022-12-15 18:16:46', '2023-10-04 13:50:58', 1, 'Petrol-prices-still-high-in-your-city?-Centre-blames-THESE-for-costly-fuel-!', 'c1ae896415041d9173d4935145243c14.jpg', 12, 'admin', 'almactar'),
(4, 'Lionel Messi to Kylian Mbappe: Race to FIFA World Cup 2022 Golden Boot, in PICS', 5, 5, '<p>The FIFA World Cup 2022 final are set with Lionel Messis Argentina set to take on Kylian Mbappe France at the Lusail Stadium on Sunday (December 18). Messi and Mbappe, teammates at PSG, are also in the race to win the FIFA World Cup 2022 Golden Boot award as well. In these collection of pictures, we take a look at players in race to win Golden Boot award this year.</p><p>The FIFA World Cup 2022 final are set with Lionel Messis Argentina set to take on Kylian Mbappe France at the Lusail Stadium on Sunday (December 18). Messi and Mbappe, teammates at PSG, are also in the race to win the FIFA World Cup 2022 Golden Boot award as well. In these collection of pictures, we take a look at players in race to win Golden Boot award this year.</p><p>The FIFA World Cup 2022 final are set with Lionel Messis Argentina set to take on Kylian Mbappe France at the Lusail Stadium on Sunday (December 18). Messi and Mbappe, teammates at PSG, are also in the race to win the FIFA World Cup 2022 Golden Boot award as well. In these collection of pictures, we take a look at players in race to win Golden Boot award this year.</p><p>The FIFA World Cup 2022 final are set with Lionel Messis Argentina set to take on Kylian Mbappe France at the Lusail Stadium on Sunday (December 18). Messi and Mbappe, teammates at PSG, are also in the race to win the FIFA World Cup 2022 Golden Boot award as well. In these collection of pictures, we take a look at players in race to win Golden Boot award this year.</p><p><br></p>', '2022-12-15 18:22:51', '2023-10-04 16:08:04', 1, 'Lionel-Messi-to-Kylian-Mbappe:-Race-to-FIFA-World-Cup-2022-Golden-Boot,-in-PICS', 'cefb64713b6ae016047d3bcd8a38e1cc.jpg', 15, 'admin', NULL),
(5, 'Twitter suspends journalists from NYT, Washington Post and others covering Elon Musk: Report', 2, 11, 'The Washington Posts Drew Harwell, alongside other banned reporters, was able to participate in a Twitter Spaces audio session while under suspension, exposing a loophole in Twitter’s enforcement.\r\n\r\n\r\nTwitter Inc. suspended the accounts of upstart rival service Mastodon and several prominent journalists covering the social network’s billionaire owner Elon Musk.\r\n\r\nLate Thursday, reporters from publications including the Washington Post, the New York Times, Mashable and CNN were listed as blocked and their tweets were no longer visible, with the companys standard notice saying it suspends accounts that violate the Twitter rules.\r\n\r\nAlso affected was sports and political commentator Keith Olbermann. Musk said Olbermann will be subject to a 7-day suspension for doxxing. In a separate tweet, he alleged the suspended journalists had posted his exact real-time location, describing the information as basically assassination coordinates.', '2022-12-16 11:34:26', '2023-10-04 15:37:27', 1, 'Twitter-suspends-journalists-from-NYT,-Washington-Post-and-others-covering-Elon-Musk:-Report', 'd7c9faa1953eebd19b2ae47f7f201858.jpg', 14, 'admin', 'admin'),
(7, 'Introducing Moch Dimas Almahtar: The Multi-Talented Indonesian Musician and Innovator', 1, 1, '<p>[Bogor, 4 Oktober 2023] - Moch Dimas Almahtar, dikenal dengan panggilan Dimas Hop, ARTCHIVE DMZ, dan ARTCHIVE Beat, muncul sebagai seniman multitalenta Indonesia yang siap mengguncang industri musik dan kreatif. Lahir pada tanggal 16 Januari 2000 di Bogor dan dibesarkan dalam budaya yang bersemangat di Sukabumi, Dimas mencerminkan semangat kreativitas dan inovasi yang tak terbatas.</p><p><br></p><p>Dimas memulai perjalanan musiknya pada tahun 2014, awalnya sebagai rapper pemula. Dia mengasah keterampilan liriknya melalui kolaborasi dengan grup Threelogy Hip-Hop yang dinamis di Depok. Pada tahun 2015, setelah pindah ke Sukabumi, Dimas mulai memamerkan bakatnya dengan merilis singel-singel melalui platform musik online ternama, Reverbnation.</p><p><br></p><p>Tahun 2016 menjadi titik balik penting ketika Dimas mendirikan kelompok hip-hop dinamis yang dikenal sebagai MFS (Moher**ker Squad), bersama musisi sejawat DYVV dan WibuSex. Tahun berikutnya, dia merilis mini-album berjudul \"Semester Satu,\" yang terdiri dari enam lagu yang penuh gairah. Rilisan ini menarik perhatian media lokal, memperkokoh kehadiran Dimas, dan mengumpulkan penggemar setia di kalangan penggemar hip-hop.</p><p><br></p><p>Selain kepiawaiannya sebagai rapper dan penulis lagu, Dimas memiliki keterampilan luar biasa sebagai produser musik, dikenal dengan nama samaran Almactar Beat. Dia dengan cekatan menciptakan beat untuk berbagai lagu yang diproduksi oleh anggota komunitas MFS. Kemudian, sejalan dengan keterlibatannya dalam kolektif hak kekayaan intelektual ARTCHIVE, dia beralih nama produsernya menjadi ARTCHIVE Beat.</p><p><br></p><p>ARTCHIVE, yang didirikan bersama oleh Dimas dan sesama kreatif ARTCHIVE DMZ, ARTCHIVE SXX, dan ARTCHIVE VSL, merupakan pusat kekuatan intelektual dan artistik yang berakar dalam musik, seni visual, desain, dan konsep-konsep visioner. Dengan fokus kuat pada menghubungkan beragam perspektif dan membangun jembatan, setiap anggota kolektif ini memberikan keahlian dan kreativitas unik mereka. ARTCHIVE DMZ dan ARTCHIVE SXX, keduanya musisi dan penulis lagu berbakat, memperkuat kepiawaian musik kolektif ini, sementara ARTCHIVE SXX menambah dimensi ilustrasi berbakat. ARTCHIVE VSL, seorang desainer grafis dan pencipta visual, menawarkan perspektif visual yang memperkaya upaya kolektif ini. Terakhir, ARTCHIVE Beat, yang sebelumnya dikenal sebagai Almactar Beat, terus menghasilkan musik yang merasuk dalam hati pendengarnya.</p><p><br></p><p>Kolektif ini berbagi keyakinan mendalam dalam melihat dunia melalui lensa artistik dan membudayakan budaya inovasi, harmoni, dan kerja sama. ARTCHIVE bertujuan untuk menginspirasi dan memicu percakapan kreatif di berbagai bidang seni dan budaya, menciptakan efek domino ekspresi seni dan sinergi kolaboratif.</p><p><br></p><p>Perjalanan seni Moch Dimas Almahtar, yang ditandai oleh keluwesan dan inovasi, berjanji untuk meninggalkan jejak mendalam pada lanskap musik dan kreatif Indonesia. Dedikasinya yang teguh terhadap eksplorasi seni dan kolaborasi menjadi inspirasi bagi semua yang mengalami karyanya.</p><p><br></p><p><b>Untuk pertanyaan media, silakan hubungi:</b></p><p>Instagram :<a href=\"https://www.instagram.com/dmz.artchive/\"> @dmz.artchive.me</a></p><p><br></p><p><b>Tentang Moch Dimas Almahtar</b></p><p>Moch Dimas Almahtar, yang dikenal dengan panggilan Dimas Hop, ARTCHIVE DMZ, dan ARTCHIVE Beat, adalah seniman multitalenta Indonesia yang menggeluti dunia musik sebagai rapper, penulis lagu, dan produser musik. Lahir di Bogor dan dibesarkan di Sukabumi, Dimas telah memberikan kontribusi signifikan pada industri musik dan kreatif. Keterlibatannya dalam kolektif hak kekayaan intelektual ARTCHIVE semakin menegaskan komitmennya terhadap inovasi dan eksplorasi artistik.</p><p><b>Tentang ARTCHIVE</b></p><p>ARTCHIVE adalah kolektif intelektual dan artistik yang didirikan oleh Moch Dimas Almahtar dan sesama kreatif. Dengan dasar yang kuat dalam musik, seni visual, desain, dan konsep-konsep visioner, ARTCHIVE bertujuan untuk menghubungkan beragam perspektif dan membangun jembatan di dunia kreatif. Setiap anggota kolektif ini memberikan keahlian dan kreativitas unik mereka, membina budaya inovasi dan kerja sama.</p>', '2023-10-03 19:31:34', '2023-10-04 19:40:04', 1, 'Introducing-Moch-Dimas-Almahtar:-The-Multi-Talented-Indonesian-Musician-and-Innovator', 'cfe5629d970598e8a58e5cc82e64a16f.png', 44, 'almactar', 'almactar'),
(8, 'PM Thailand MENGAMBIL KEPUTUSAN MENDRAMATIS TENTANG MARIJUANA', 1, 17, '<p><span style=\"border: 0px solid rgb(217, 217, 227); --tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-gradient-from-position: ; --tw-gradient-via-position: ; --tw-gradient-to-position: ; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgba(69,89,164,.5); --tw-ring-offset-shadow: 0 0 transparent; --tw-ring-shadow: 0 0 transparent; --tw-shadow: 0 0 transparent; --tw-shadow-colored: 0 0 transparent; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ; font-weight: 600; color: var(--tw-prose-bold); font-family: Söhne, ui-sans-serif, system-ui, -apple-system, &quot;Segoe UI&quot;, Roboto, Ubuntu, Cantarell, &quot;Noto Sans&quot;, sans-serif, &quot;Helvetica Neue&quot;, Arial, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px; white-space-collapse: preserve; background-color: rgb(247, 247, 248);\">Apakah Ini Artinya Highland Kembali Menjadi Thailand?</span></p><p><span style=\"border: 0px solid rgb(217, 217, 227); --tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pin