ing-shadow: 0 0 transparent; --tw-shadow: 0 0 transparent; --tw-shadow-colored: 0 0 transparent; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ; color: rgb(55, 65, 81); font-weight: 400;\">Bangkok, 4 Oktober 2023</em><span style=\"color: rgb(55, 65, 81); font-weight: 400;\"> - Dalam salah satu contoh nyata kehidupan meniru seni, beberapa bulan lalu, LiFTED menulis artikel satir tentang bagaimana para rapper telah mengonsumsi terlalu banyak ganja sehingga pemerintah memutuskan untuk mengkaji ulang undang-undang legalisasi ganja di Thailand sebagai lelucon April Mop. Namun, dalam sepekan terakhir, Perdana Menteri baru, Srettha Thavisin, mengeluarkan seruan untuk menyusun undang-undang komprehensif yang hanya mengizinkan penggunaan medis dan penelitian tentang ganja, sementara penggunaan rekreasional dilarang kembali.</span></span></p><p><span style=\"border: 0px solid rgb(217, 217, 227); --tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-gradient-from-position: ; --tw-gradient-via-position: ; --tw-gradient-to-position: ; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgba(69,89,164,.5); --tw-ring-offset-shadow: 0 0 transparent; --tw-ring-shadow: 0 0 transparent; --tw-shadow: 0 0 transparent; --tw-shadow-colored: 0 0 transparent; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ; font-weight: 600; color: var(--tw-prose-bold); font-family: Söhne, ui-sans-serif, system-ui, -apple-system, &quot;Segoe UI&quot;, Roboto, Ubuntu, Cantarell, &quot;Noto Sans&quot;, sans-serif, &quot;Helvetica Neue&quot;, Arial, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px; white-space-collapse: preserve; background-color: rgb(247, 247, 248);\"><span style=\"color: rgb(55, 65, 81); font-weight: 400;\"><br></span></span></p><p><span style=\"border: 0px solid rgb(217, 217, 227); --tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-gradient-from-position: ; --tw-gradient-via-position: ; --tw-gradient-to-position: ; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgba(69,89,164,.5); --tw-ring-offset-shadow: 0 0 transparent; --tw-ring-shadow: 0 0 transparent; --tw-shadow: 0 0 transparent; --tw-shadow-colored: 0 0 transparent; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ; font-weight: 600; color: var(--tw-prose-bold); font-family: Söhne, ui-sans-serif, system-ui, -apple-system, &quot;Segoe UI&quot;, Roboto, Ubuntu, Cantarell, &quot;Noto Sans&quot;, sans-serif, &quot;Helvetica Neue&quot;, Arial, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px; white-space-collapse: preserve; background-color: rgb(247, 247, 248);\"><img src=\"https://liftedasia.com/assets/content_images/weed.webp\" style=\"width: 50%;\"></span></p><p><br></p><p>Setelah pemilihan umum baru-baru ini, di mana Partai Move Forward yang progresif berhasil memenangkan dengan angka yang mengesankan dan janji untuk menjauh dari pemerintahan yang bersifat militer dan monarki, pemimpin muda dan karismatik mereka, Pita Limjaroenrat, dicekal untuk menjadi Perdana Menteri. Partai Pheu Thai seharusnya membantu Partai Move Forward untuk mewujudkan keinginan demokratis rakyat.&nbsp;</p><p><br></p><p>Namun, Pheu Thai memutuskan untuk bersekutu dengan beberapa partai militer yang sebelumnya mereka lawan dalam kampanye demi mengantarkan Srettha ke posisi paling berkuasa di Kerajaan. Meskipun ini adalah kemenangan jangka pendek, tindakan ini akan merugikan Pheu Thai dalam jangka panjang, karena para pemuda yang merupakan masa depan Thailand akan mengingat pengkhianatan ini, dan sebanyak 65 persen dari masyarakat umum percaya bahwa tindakan ini sangat tidak jujur.</p><p><br></p><p>Sebagai negara Asia pertama yang melegalkan ganja, tentu saja ada hambatan dan kerikil di sepanjang jalan, terutama karena dilakukan tanpa regulasi yang memadai. Oposisi menyatakan bahwa 10 persen pemuda kini kecanduan ganja, sebuah statistik yang sulit dipercaya. Meskipun begitu, pemerintah berencana untuk melanjutkan dengan undang-undang baru ini dalam satu tahun. Kembalinya legalisasi ganja akan merugikan para pelaku industri pariwisata, petani, produsen, pemilik bisnis, dan banyak rapper karena mereka telah bekerja keras dalam industri ganja.</p><div><br></div>', '2023-10-03 20:21:51', '2023-10-04 18:42:29', 1, 'PM-Thailand-MENGAMBIL-KEPUTUSAN-MENDRAMATIS-TENTANG-MARIJUANA', '8e8f1a317a406c4b1b876d93751855ba.png', 11, 'almactar', NULL);
INSERT INTO `tblposts` (`id`, `PostTitle`, `CategoryId`, `SubCategoryId`, `PostDetails`, `PostingDate`, `UpdationDate`, `Is_Active`, `PostUrl`, `PostImage`, `viewCounter`, `postedBy`, `lastUpdatedBy`) VALUES
(9, 'Rich Brian 2023 China Tour: Perhentian Spektakuler di Chengdu', 1, 1, '<p>[Chengdu, 3 Oktober 2023]* - Tur China 2023 oleh Rich Brian, yang mencakup perhentian pertamanya di Chengdu, berakhir dengan sukses gemilang, memberikan pengalaman tak terlupakan bagi para penggemar musik di seluruh wilayah ini.</p><p><img src=\"data:image/jpeg;base64,\" data-filename=\"Screenshot_20231004-193114.jpg\" style=\"width: 50%;\"></p><p><br></p><p>Malam yang diberkati dengan suara rap yang fenomenal, Rich Brian mengguncang Stasiun Chengdu dengan penampilan yang energik dan penuh semangat. Para penonton tidak hanya disuguhi rap khas dari Rich Brian, tetapi juga penampilan luar biasa dari Warren Hue dan KnowKnow yang membawa panggung ini semakin membara.</p><p><br></p><p>Dalam sebuah pernyataan setelah penampilan mereka, Rich Brian bersama dengan Warren Hue dan KnowKnow bersukacita atas respons positif dari penggemar mereka di Chengdu. Mereka mengungkapkan rasa terima kasih mereka kepada semua yang hadir dan berterima kasih atas semangat luar biasa yang mereka rasakan di malam itu.</p><p><br></p><p>\"Berteriaklah untuk SEJARAH yang kami buat! Perhentian ini adalah yang pertama dari banyak yang akan datang, dan Chengdu memberikan sambutan yang luar biasa,\" kata Rich Brian dengan antusiasme.</p><p><br></p><p>Perhentian berikutnya dalam tur ini akan berlangsung di Shanghai besok malam. Penggemar di seluruh kota ini sudah menantikan penampilan yang akan datang dengan antusiasme besar.</p><p><a href=\"https://pr.almahtar.eu.org/news-details.php?nid=7\">Lainnya</a></p><p><br></p><p>Rich Brian dan timnya, yang saat ini berada dalam perjalanan mereka melintasi Cina, berjanji untuk memberikan lebih banyak pengalaman musik yang luar biasa dalam tur ini. Mereka mengundang semua penggemar untuk bergabung dengan mereka dalam petualangan musik yang penuh semangat ini.</p><p><br></p><p>Jika Anda belum memiliki tiket untuk salah satu perhentian tur ini, pastikan untuk segera mendapatkannya, karena tiket sedang terjual habis. Tur China 2023 Rich Brian adalah salah satu acara musik yang paling dinanti-nantikan tahun ini, dan dengan penampilan spektakuler di Chengdu, ekspektasi hanya semakin tinggi.</p><p><br></p><p>Terus pantau Press Indo untuk liputan lengkap mengenai tur luar biasa ini dan berita musik terbaru lainnya.</p>', '2023-10-04 12:45:31', '2023-10-04 19:39:11', 1, 'Rich-Brian-2023-China-Tour:-Perhentian-Spektakuler-di-Chengdu', 'fa6b2e7c56b01dd804a2247085fe0ae8.jpg', 20, 'almactar', 'almactar');
